// Inserisci dati nel form
cy.get('#userName').type('Marco Rossi');
cy.get('#userEmail').type('marco@example.com');
cy.get('#currentAddress').type('Via Roma 1, Milano');
cy.get('#permanentAddress').type('Via Milano 2, Milano');
// Clicca submit
cy.get('#submit').click({
  force: true
});
// Verifica che i dati inseriti siano mostrati nella sezione output
cy.get('#output #name').should('contain.text', 'Marco Rossi');
cy.get('#output #email').should('contain.text', 'marco@example.com');
cy.get('#output #currentAddress').should('contain.text', 'Via Roma 1, Milano');
cy.get('#output #permanentAddress').should('contain.text', 'Via Milano 2, Milano');
